import React, { useEffect } from "react";

// Define the System interface for type safety
interface System {
  _id: string;
  type: string;
  workflowItems?: string[];
  vendorType?: string;
  vendorName?: string;
  year?: number;
  make?: string;
  model?: string;
}

// Props for the SystemTable component
interface SystemTableProps {
  systems: System[]; // Array of systems passed to the component
}

// Component for displaying systems grouped by type (workflow, vendor solution, vehicle)
const SystemTable: React.FC<SystemTableProps> = ({ systems }) => {
  // Log the systems data for debugging
  useEffect(() => {
    console.log("Received systems data:", systems);
  }, [systems]);

  // Filter systems by type
  const workflows = systems.filter((system) => system.type === "workflow");
  const vendorSolutions = systems.filter(
    (system) => system.type === "vendorSolution"
  );
  const vehicles = systems.filter((system) => system.type === "vehicle");

  // Log the filtered system types for debugging
  console.log("Workflows:", workflows);
  console.log("Vendor Solutions:", vendorSolutions);
  console.log("Vehicles:", vehicles);

  return (
    <>
      {/* Workflow Table */}
      <h3 className="text-xl font-semibold mb-4">Workflow Systems</h3>
      {workflows.length > 0 ? (
        <table className="min-w-full table-auto bg-white shadow-lg mb-8">
          <thead>
            <tr>
              <th className="px-4 py-2">Workflow Items</th>
            </tr>
          </thead>
          <tbody>
            {workflows.map((workflow) => (
              <tr key={workflow._id}>
                <td className="border px-4 py-2">
                  {workflow.workflowItems?.join(", ")}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p>No workflow systems available.</p>
      )}

      {/* Vendor Solutions Table */}
      <h3 className="text-xl font-semibold mb-4">Vendor Solutions</h3>
      {vendorSolutions.length > 0 ? (
        <table className="min-w-full table-auto bg-white shadow-lg mb-8">
          <thead>
            <tr>
              <th className="px-4 py-2">Vendor Type</th>
              <th className="px-4 py-2">Vendor Name</th>
            </tr>
          </thead>
          <tbody>
            {vendorSolutions.map((solution) => (
              <tr key={solution._id}>
                <td className="border px-4 py-2">{solution.vendorType}</td>
                <td className="border px-4 py-2">{solution.vendorName}</td>
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p>No vendor solutions available.</p>
      )}

      {/* Vehicle Table */}
      <h3 className="text-xl font-semibold mb-4">Vehicles</h3>
      {vehicles.length > 0 ? (
        <table className="min-w-full table-auto bg-white shadow-lg mb-8">
          <thead>
            <tr>
              <th className="px-4 py-2">Year</th>
              <th className="px-4 py-2">Make</th>
              <th className="px-4 py-2">Model</th>
            </tr>
          </thead>
          <tbody>
            {vehicles.map((vehicle) => (
              <tr key={vehicle._id}>
                <td className="border px-4 py-2">{vehicle.year}</td>
                <td className="border px-4 py-2">{vehicle.make}</td>
                <td className="border px-4 py-2">{vehicle.model}</td>
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p>No vehicles available.</p>
      )}
    </>
  );
};

export default SystemTable;
